import re
from datetime import datetime
import matplotlib.pyplot as plt
result_list = []

def calculate_test_cases_per_second(file_path):
    # Regular expression to find Average Throughput Time, Current Time, and Start Time in the logs
    throughput_time_pattern = re.compile(r"DSLOG: Average throughput time: (\d+\.\d+)")
    time_pattern = re.compile(r"DSLOG: Current time: (\d{2})/(\d{2})/(\d{4}) (\d{2}):(\d{2}):(\d{2})")
    start_time_pattern = re.compile(r"DSLOG: Time of start = (\d{2})/(\d{2})/(\d{4}) (\d{2}):(\d{2}):(\d{2})")

    # List to store the result as tuples (timepoint, test_cases_per_second, time_difference_from_start)
   

    # Read the log file and process each line
    with open(file_path, "r") as file:
        current_time = None
        start_time = None

        for line in file:
            # Match the start time only once at the beginning
            start_time_match = start_time_pattern.search(line)
            if start_time_match and start_time is None:
                # Extract the start time from the log
                start_time = datetime(
                    int(start_time_match.group(3)),  # Year
                    int(start_time_match.group(2)),  # Month
                    int(start_time_match.group(1)),  # Day
                    int(start_time_match.group(4)),  # Hour
                    int(start_time_match.group(5)),  # Minute
                    int(start_time_match.group(6))   # Second
                )

            # Match the current time
            time_match = time_pattern.search(line)
            throughput_match = throughput_time_pattern.search(line)

            if time_match:
                # Extract the current time from the log
                current_time = datetime(
                    int(time_match.group(3)),  # Year
                    int(time_match.group(2)),  # Month
                    int(time_match.group(1)),  # Day
                    int(time_match.group(4)),  # Hour
                    int(time_match.group(5)),  # Minute
                    int(time_match.group(6))   # Second
                )

            if throughput_match and current_time and start_time:
                # Extract the Average Throughput Time
                avg_throughput_time = float(throughput_match.group(1))

                # Calculate Test Cases per Second
                test_cases_per_second = 1 / avg_throughput_time

                # Calculate the time difference from the start
                time_difference = current_time - start_time
                time_difference_in_hours = time_difference.total_seconds() / 3600

                # Append the tuple (test_cases_per_second, time_difference_in_hours) to the result list
                result_list.append((test_cases_per_second, time_difference_in_hours))

                # Reset current_time for the next iteration
                current_time = None

    # Print the entire list of timepoints, test cases per second, and time differences from the start
    for tps, time_diff in result_list:
        print(f"Test Cases per Second: {tps} -> Time Difference from Start -> {time_diff}")
